import React, { useState } from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';

// Styled Components
const PageContainer = styled.div`
  padding: 120px 5% 80px;
  min-height: 100vh;
`;

const PageTitle = styled.h1`
  font-size: 3.5rem;
  font-weight: 300;
  margin-bottom: 40px;
  color: ${props => props.theme.colors.secondary};
  position: relative;
  letter-spacing: -1px;
  
  &:after {
    content: '';
    position: absolute;
    bottom: -20px;
    left: 0;
    width: 60px;
    height: 1px;
    background-color: ${props => props.theme.colors.highlight};
  }
`;

const IntroText = styled.p`
  font-size: 1.3rem;
  line-height: 1.8;
  color: ${props => props.theme.colors.textSecondary};
  margin-bottom: 60px;
  max-width: 900px;
`;

const ModelsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 30px;
  margin-bottom: 60px;
  
  @media (max-width: ${props => props.theme.breakpoints.tablet}) {
    grid-template-columns: repeat(2, 1fr);
  }
  
  @media (max-width: ${props => props.theme.breakpoints.mobile}) {
    grid-template-columns: 1fr;
  }
`;

const ModelCard = styled.div<{ selected: boolean }>`
  background-color: rgba(10, 10, 10, 0.8);
  backdrop-filter: blur(10px);
  position: relative;
  transition: all 0.4s ease;
  padding: 20px;
  border: 1px solid ${props => props.selected ? props.theme.colors.highlight : 'rgba(255, 255, 255, 0.1)'};
  box-shadow: ${props => props.selected ? '0 15px 30px rgba(155, 133, 121, 0.2)' : '0 10px 20px rgba(0, 0, 0, 0.2)'};
  cursor: pointer;
  
  &:hover {
    transform: translateY(-5px);
    border-color: ${props => props.theme.colors.highlight};
  }
`;

const ModelImage = styled.div`
  height: 180px;
  margin-bottom: 20px;
  overflow: hidden;
  
  img {
    width: 100%;
    height: 100%;
    object-fit: cover;
    transition: transform 0.6s ease;
  }
  
  ${ModelCard}:hover img {
    transform: scale(1.05);
  }
`;

const ModelName = styled.h3`
  font-size: 1.4rem;
  font-weight: 300;
  margin-bottom: 10px;
  color: ${props => props.theme.colors.secondary};
  letter-spacing: 0.5px;
`;

const ModelCategory = styled.span`
  display: inline-block;
  font-size: 0.8rem;
  font-weight: 500;
  color: ${props => props.theme.colors.primary};
  background-color: ${props => props.theme.colors.highlight};
  padding: 4px 12px;
  margin-bottom: 15px;
  text-transform: uppercase;
  letter-spacing: 1px;
`;

const SelectButton = styled.button`
  background-color: ${props => props.theme.colors.highlight};
  color: ${props => props.theme.colors.primary};
  font-size: 1rem;
  font-weight: 500;
  padding: 15px 30px;
  border: none;
  text-transform: uppercase;
  letter-spacing: 2px;
  transition: all 0.3s ease;
  display: flex;
  align-items: center;
  justify-content: space-between;
  width: 200px;
  margin: 0 auto 80px;
  
  &:hover {
    background-color: ${props => props.theme.colors.secondary};
  }
  
  &:after {
    content: '→';
    font-size: 1.2rem;
    margin-left: 10px;
  }
`;

interface ModelType {
  id: string;
  name: string;
  category: string;
  image: string;
}

const TestDrivePage: React.FC = () => {
  const [selectedModel, setSelectedModel] = useState<string | null>(null);
  const navigate = useNavigate();
  
  const models: ModelType[] = [
    { id: 'lbx', name: 'Lexus LBX', category: 'Compact', image: '/images/lexus_lbx.png' },
    { id: 'ux', name: 'Lexus UX', category: 'Compact SUV', image: '/images/lexus_ux.png' },
    { id: 'rz', name: 'Lexus RZ', category: 'Electric', image: '/images/lexus_rz.png' },
    { id: 'nx', name: 'Lexus NX', category: 'SUV', image: '/images/lexus_nx.png' },
    { id: 'rx', name: 'Lexus RX', category: 'Premium SUV', image: '/images/lexus_rx.png' },
    { id: 'es', name: 'Lexus ES', category: 'Sedan', image: '/images/lexus_es.png' },
    { id: 'ls', name: 'Lexus LS', category: 'Luxury Sedan', image: '/images/lexus_ls.png' },
  ];
  
  const handleSelectCar = () => {
    if (selectedModel) {
      alert(`Thank you for selecting the ${models.find(m => m.id === selectedModel)?.name}. A Lexus representative will contact you shortly to schedule your test drive.`);
      navigate('/experience');
    }
  };
  
  return (
    <PageContainer>
      <PageTitle>Schedule a Test Drive</PageTitle>
      
      <IntroText>
        Experience the exceptional performance, craftsmanship, and innovation of Lexus firsthand. Select a model below to schedule your personalized test drive.
      </IntroText>
      
      <ModelsGrid>
        {models.map(model => (
          <ModelCard 
            key={model.id} 
            selected={selectedModel === model.id}
            onClick={() => setSelectedModel(model.id)}
          >
            <ModelImage>
              <img src={model.image} alt={model.name} />
            </ModelImage>
            <ModelCategory>{model.category}</ModelCategory>
            <ModelName>{model.name}</ModelName>
          </ModelCard>
        ))}
      </ModelsGrid>
      
      {selectedModel && (
        <SelectButton onClick={handleSelectCar}>
          Pick this car
        </SelectButton>
      )}
    </PageContainer>
  );
};

export default TestDrivePage;
